import TreeOnTreeGame from "./TreeOnTreeGame";

const Body = () => {
    return ( 
        <div>
            <div className="row">
                <div className="col"><button onClick={() => {return <TreeOnTreeGame />}}>3x3</button></div>
                <div className="col"><button>4x4</button></div>
                <div className="col"><button>5x5</button></div>
            </div>
        </div>
     );
}

export default Body;
